","Height":"2000","Width":"2000"}},{"@attributes":{"Category":"variant"},"SwatchImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/5189ZHn%2BlIL._SL30_.jpg","Height":"30","Width":"30"},"SmallImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/5189ZHn%2BlIL._SL75_.jpg","Height":"75","Width":"75"},"ThumbnailImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/5189ZHn%2BlIL._SL75_.jpg","Height":"75","Width":"75"},"TinyImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/5189ZHn%2BlIL._SL110_.jpg","Height":"110","Width":"110"},"MediumImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/5189ZHn%2BlIL._SL160_.jpg","Height":"160","Width":"160"},"LargeImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/5189ZHn%2BlIL.jpg","Height":"500","Width":"500"},"HiResImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/81tlHgvkwoL.jpg","Height":"2000","Width":"2000"}},{"@attributes":{"Category":"primary"},"SwatchImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/4143T5SdHmL._SL30_.jpg","Height":"30","Width":"30"},"SmallImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/4143T5SdHmL._SL75_.jpg","Height":"75","Width":"75"},"ThumbnailImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/4143T5SdHmL._SL75_.jpg","Height":"75","Width":"75"},"TinyImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/4143T5SdHmL._SL110_.jpg","Height":"110","Width":"110"},"MediumImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/4143T5SdHmL._SL160_.jpg","Height":"160","Width":"160"},"LargeImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/4143T5SdHmL.jpg","Height":"500","Width":"500"},"HiResImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/61kFv2KuJ2L.jpg","Height":"1500","Width":"1500"}}]', 'Personal Care', 'Braun', '{"Brand":"Braun","Model":"81475974","MPN":"81475974"}', NULL, '["Faster and most precise epilation* for up to 4 weeks of smooth skin *vs other Braun epilators","The 40% wider epilation head removes more hair in one stroke*, even the shortest that waxing cannot catch *vs other Braun epilators","Cordless Wet & Dry use - Virtually painless with regular use","Includes a facial epilator to precisely remove even the finest facial hair from the root for long lasting smooth skin","With 3 extras: a face epilator, a high frequency massage cap and a skin contact cap"]', '{"Height":"591","Length":"1181","Weight":"126","Width":"787"}', 'GBP', '6999', '15999', NULL, '9000', '81475974', 'Health and Beauty', NULL, 'Increase speed and efficiency without sacrificing comfort or quality. Silk-Ã©pil 9 Comes with a 40% wider head then previous Silk-Ã©pil epilators meaning covers more ground with every stroke, for fewer strokes total. Not only that but thanks to MicroGrip tweezer technology the epilator removes more hair in each stroke then before too! The in-built high frequency massage system stimulates the skin and effectively soothes the plucking sensation during epilation to maximize your skin comfort. Skin contour adaptation ensures it runs comfortably and smoothly across your skin by matching your body\'s natural curves and bends. Ensuring you don\'t miss anything, Smartlight helps easily guide your way through the epilation process and lightens up even the finest hairs for no miss removal and speed. The Silk-Ã©pil 5 also comes with two speed settings allowing you to easily flick between two modes of use for more specialised performance: speed 1 for slow gentle epilation, ideal for grooming delicate and sensitive areas; speed 2 on the other hand offers faster efficient epilation, ideal for scouring tougher areas such as the legs. Hosting a built-in rechargeable battery, the Silk-Ã©pil 9 provides 40 minutes of cordless use when fully charged and has a charge time of just one hour. Another major benefit to the Silk-Ã©pil 9 is that it uses special Wet & Dry technology, meaning its completely waterproof for cordless epilation that can be used in the shower. This kit also comes with five extras: Shaver head, trimmer cap, high frequency massage cap, skin contact cap, and a specialised facial epilator for precisely eliminating unwanted facial hairs. 10 Micro-openings capture finest hairs. For chin, upper lip, forehead area and eyebrows.', '', '', '', NULL, 'Review and List', 1, '110225656868', NULL, 95.98, 0, 0, 0, '2017-06-22 13:39:31', '2017-06-22 13:39:31'),
