g 1 ms response time","Capable of mouse movement speeds of up to 210 inches per second and 50 G acceleration, the Razer Orochi\'s 4G laser sensor delivers uncompromised accuracy - from blazing speed to pinpoint steadiness","Fully supported by Razer Synapse, you can push your performance to the limit by customizing your Razer Orochi, tuning it perfectly to your unique specifications","Coupled with Bluetooth Low Energy connectivity, the Razer Orochi provides 60 hours of continuous gameplay, or 7 months of normal usage*, so you get over 3x more battery life than its predecessor","Please ensure your laptop or Bluetooth adapter is Bluetooth 4.0 compliant for compatibility with Razer Orochi","Chroma lighting with true 16.8 million customizable color options","8,200 DPI laser sensor for pinpoint accuracy","7 months of battery life for extended gaming on the go","210 inches per second \\/ 50 G acceleration","Ambidextrous form factor with textured rubber side grips"]', '{"Height":"390","Length":"264","Weight":"25","Width":"138"}', 'USD', '8323', NULL, NULL, NULL, 'RZ01-01550100-R3U1', 'Personal Computer', NULL, 'The Razer Orochi\'s 8200dpi 4G laser sensor takes out the competition with deadly accuracy. Achieve both the frenzy of wired and the freedom of wireless play with the Razer Orochi. It performs equally well both wired and through wireless Bluetooth 3.0 connectivity found in most laptops.', '', '', '', NULL, 'Review and List', 1, '110225647747', NULL, 82.07, 0, 0, 0, '2017-09-26 08:34:11', '2017-09-26 08:34:11'),
