e: 34 * 34 * 10cm / 13.4 * 13.4 * 3.9inch, Please check the size of chair and the height between chair and table before purchasing<br> 5 Be suitable for children over 2 years of age who sit unaided at table<br> 6 Color: Blue Star/ Gray Star / Red Star / Coffee Star<br> <br> <br> <b>Package includes:</b> <br> 1 x Booster Cushion<br> <br> <br> <b>Please note:</b><br> 1. Just Fits chairs, should not be used for the aircraft , car seat etc<br> 2. Due to the difference between different monitors, the picture may not reflect the exact color of the item, We strive to make our colors as accurate as possible<br> <br> <br> <b>We Guarantee Excellent Quality of Our Products and Satisfy You Is Our Eternal Aim, Thank You for Choosing Zicac!</b></p>', '', '', '', NULL, 'Review and List', 1, '110225663498', NULL, 23.23, 0, 0, 0, '2017-09-27 11:23:35', '2017-09-27 11:23:35');
