mages-eu.ssl-images-amazon.com/images/I/51AzF372RBL._SL110_.jpg","Height":"110","Width":"95"},"MediumImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/51AzF372RBL._SL160_.jpg","Height":"160","Width":"138"},"LargeImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/51AzF372RBL.jpg","Height":"500","Width":"431"},"HiResImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/717oI9hcY2L.jpg","Height":"1253","Width":"1080"}},{"@attributes":{"Category":"variant"},"SwatchImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/51MaTLnozhL._SL30_.jpg","Height":"30","Width":"30"},"SmallImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/51MaTLnozhL._SL75_.jpg","Height":"75","Width":"74"},"ThumbnailImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/51MaTLnozhL._SL75_.jpg","Height":"75","Width":"74"},"TinyImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/51MaTLnozhL._SL110_.jpg","Height":"110","Width":"109"},"MediumImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/51MaTLnozhL._SL160_.jpg","Height":"160","Width":"159"},"LargeImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/51MaTLnozhL.jpg","Height":"500","Width":"496"}},{"@attributes":{"Category":"primary"},"SwatchImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/514QG3t09RL._SL30_.jpg","Height":"22","Width":"30"},"SmallImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/514QG3t09RL._SL75_.jpg","Height":"56","Width":"75"},"ThumbnailImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/514QG3t09RL._SL75_.jpg","Height":"56","Width":"75"},"TinyImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/514QG3t09RL._SL110_.jpg","Height":"82","Width":"110"},"MediumImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/514QG3t09RL._SL160_.jpg","Height":"119","Width":"160"},"LargeImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/514QG3t09RL.jpg","Height":"373","Width":"500"}}]', 'Baby Product', 'bamboo bamboo', '{"Brand":"bamboo bamboo","MPN":"1"}', 'Blue', '["ONE ALL NATURAL BAMBOO BOWL and food-grade silicone protect your child from BPA, phthalates and other toxins","POWERFUL SUCTION BASE grips the high chair tray or kiddie table to prevent spills, flips and throws","COOL-TOUCH bamboo deters burns to baby\'s delicate fingers if they reach out for it during feeding","REMOVABLE SUCTION BOTTOM lets you transition bowls to regular use when your child outgrows them","SIX CHEERY UNISEX COLOURS to choose from: Blue; Yellow; Cherry; Orange; Green or Pink. Hand-wash only"]', NULL, 'GBP', '1499', '1999', '1499', '500', NULL, 'Baby Product', NULL, '<p> <b>Protect your baby while nurturing their self-sufficiency</b> </p> <p> You baby-proofed the electrical outlets and cupboard doors, but have you baby-proofed your kitchenware? The Baby Bamboo Bowl with Silicone-Tipped Spoon and Suction Base allow you to feed your child without exposure to BPA and other chemicals that leech into food from plastic bowls and spoons. Our bamboo feeding set is lightweight, stain-resistant and naturally antimicrobial. No harsh chemicals or dyes are used to produce them. </p> <p> <b>More food IN your baby and LESS food spilled</b> </p> <p> The Baby Bamboo Bowl includes a strong suction bottom that securely adheres the bowl to any smooth surface. This prevents flipped bowls as your baby develops muscle coordination and depth perception. Bamboo remains cool to the touch. The bamboo spoon is tipped in matching silicone to be soft on baby\'s gums and protect new teeth. When meal time is over, simply lift the bowl\'s suction base release tab, wash everything by hand in warm, soapy water and you are ready for the next feeding. We use only FDA-approved food grade silicone for your precious one\'s health and well-being. Choose from six beautiful colours, suitable for either boys or girls: blue; yellow; cherry; pink; orange; or green. Please note that bamboo is not suitable for microwave oven or dishwasher. </p> <p> <b>Your home never outgrows the Baby Bamboo Bowl</b> </p> <p> When your child is ready for regular plates and bowls, do not tuck these away. The silicone suction base removes from the bowl, and you will be able to use them yourself for soups, salads and more. </p> <p> <b>It\'s only natural to want the best for your child. Add the all-natural Baby Bamboo Bowl to your basket today.</b> </p>', '', '', '', NULL, 'Review and List', 1, '110225667253', NULL, 20.20, 0, 0, 0, '2017-09-27 12:14:29', '2017-09-27 12:14:29'),
