ectronics', 'Anker', '{"Brand":"Anker","Model":"AK-A1215011","MPN":"AK-848061090062","UPC":"848061090062"}', 'Black', '["The Anker Advantage: Join the 10 million+ powered by our leading technology.","Upgraded Capacity: The successor to PowerCore 10400-identical compact size but packed with even more power. Charges an iPhone 6s almost 5 times, a Galaxy S6 3 times or an iPad Air 2 once.","Light and Compact: A super-high 13000 mAh capacity with two high-speed USB ports is all contained in a portable charger smaller than a wallet.","High-Speed Charging: PowerIQ and VoltageBoost combine to deliver the fastest possible charge up to 2.4 amps per port or 3 amps overall. Input: 5V \\/ 2A.","What You Get: Anker PowerCore 130000 Portable Charger, Micro USB cable, travel pouch, welcome guide, our worry-free 18-month warranty and friendly customer service."]', '{"Height":"87","Length":"384","Weight":"1","Width":"315"}', 'GBP', '2399', NULL, NULL, NULL, 'AK-A1215011', 'CE', NULL, '<b>PowerCore 13000</b><br> The Compact Super-High-Capacity Portable Charger<br><br> <b>From ANKER, America\'s Leading USB Charging Brand</b><br> â€¢ Faster and safer charging with our advanced technology<br> â€¢ 10 million+ happy users and counting<br><br> <b>Super-High Capacity</b><br> Enough power to keep you going for days. Charge an iPhone 6s almost 5 times, a Galaxy S6 3 times or an iPad Air 2 once.<br><br> <b>High-Speed Charging</b><br> PowerIQ ensures intelligent high-speed charging for all your devices and VoltageBoost prevents cable resistance from slowing your charging speeds.<br><br> <b>MultiProtect Safety System</b><br> Surge protection, short circuit protection and more advanced safety features keep you and your devices safe.<br><br> <b>Matte Finish</b><br> Enhances grip and prevents smudges and fingerprints.<br><br> <b>Worry-Free Warranty</b><br> At Anker, we believe in our products. That\'s why we back them all with an 18-month warranty and provide friendly, easy-to-reach support.<br><br> <b>For Optimal Use:</b><br> â€¢ Use the included cable, your original cable or a third-party certified one (such as MFi).<br> â€¢ Compatible with the new 12 inch MacBook, 2015 (USB-C cable needed), Apple and Android smartphones, tablets (including the Nexus 7) and other USB-charged devices except for the iPod nano, iPod Classic, HP TouchPad, Dell Venue 11 Pro, Asus tablets and some GPS and Bluetooth devices.', '', '', '', NULL, 'Review and List', 0, NULL, NULL, NULL, 0, 0, 0, '2017-10-04 13:39:51', '2017-10-04 13:39:51'),
