(43, 1, 1, 'B00LD5WKAO', 'US7B00LD5WKAO', 0, 10304191, 'https://www.amazon.com/New-60-Pack-Reactive-Splatter/dp/B00LD5WKAO?SubscriptionId=AKIAJL5OCKUJ5TXWF47Q&tag=dropshipping7-20&linkCode=xm2&camp=2025&creative=165953&creativeASIN=B00LD5WKAO', 'New 60 Pack - 6 Reactive Splatter Gun and Rifle Targets - Glowshot Glow Shot', NULL, NULL, 'https://images-na.ssl-images-amazon.com/images/I/51-5Z2f6YxL.jpg', '{"@attributes":{"Category":"primary"},"SwatchImage":{"URL":"https://images-na.ssl-images-amazon.com/images/I/51-5Z2f6YxL._SL30_.jpg","Height":"30","Width":"29"},"SmallImage":{"URL":"https://images-na.ssl-images-amazon.com/images/I/51-5Z2f6YxL._SL75_.jpg","Height":"75","Width":"72"},"ThumbnailImage":{"URL":"https://images-na.ssl-images-amazon.com/images/I/51-5Z2f6YxL._SL75_.jpg","Height":"75","Width":"72"},"TinyImage":{"URL":"https://images-na.ssl-images-amazon.com/images/I/51-5Z2f6YxL._SL110_.jpg","Height":"110","Width":"106"},"MediumImage":{"URL":"https://images-na.ssl-images-amazon.com/images/I/51-5Z2f6YxL._SL160_.jpg","Height":"160","Width":"154"},"LargeImage":{"URL":"https://images-na.ssl-images-amazon.com/images/I/51-5Z2f6YxL.jpg","Height":"500","Width":"480"}}', NULL, 'DASS', '{"Brand":"DASS","Features":"New 60 Pack - 6 Reactive Splatter Gun and Rifle Targets - GlowShot Glow Shot"}', NULL, '"New 60 Pack - 6 Reactive Splatter Gun and Rifle Targets - GlowShot Glow Shot"', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Single Detail Page Misc', NULL, 'Product Details:\nGlowShot 6" Multi Color Reactive Targets. You will "See Your Hits Instantly." These targets use GlowShot Technology to produce a colored ring around your hits. No more walking down range or picking a spotting scope to see your hits. Each colored ring represents 1 inch from the center. These targets are made of a heavy duty reinforced tag board to withstand dozens of shots. Attach the target to any surface. When you are done shooting, you can remove the target and take it home for analysis or bragging rights. Targets come in 25, 60 and 120 Packs. - Search GlowShot for all our 6", 8", 10" and 10"x16" Target Sizes and Packs. Response to reviews.... GlowShot products have been compared with the BC\'s 6" - 60 packs in the reviews. Here is why we think GlowShot Targets are better. GlowShot Targets are 7" x 7" with a full 6" Splatter Bull\'s-eye. BC\'s Target is only 6.5x6.25 with a bull\'s-eye smaller than 6". GlowShot Targets are Multi-Color. BC\'s have a single background color GlowShot Targets are made of Heavy Tag Board which hold up better to more hits. \n\nProduct Features:\n6" Reactive Targets\nGlowShot\n60 - Pack (25, 60 and 100 Packs Available)\nProduct Specifications:\nManufacture: Glowshot Targets\nModel: 6001-60\nManufacture Part Number: 6001-60\nApproximate Product Dimensions: 7.25" x 0.75" x 7.25" (Length x Width x Height)', NULL, NULL, NULL, NULL, 'Review and List', 0, NULL, NULL, NULL, 0, 0, 0, '2017-10-26 17:01:19', '2017-10-26 17:01:19'),
