azon.com/images/I/41CrFkDPRrL._SL75_.jpg","Height":"75","Width":"75"},"ThumbnailImage":{"URL":"https://images-na.ssl-images-amazon.com/images/I/41CrFkDPRrL._SL75_.jpg","Height":"75","Width":"75"},"TinyImage":{"URL":"https://images-na.ssl-images-amazon.com/images/I/41CrFkDPRrL._SL110_.jpg","Height":"110","Width":"110"},"MediumImage":{"URL":"https://images-na.ssl-images-amazon.com/images/I/41CrFkDPRrL._SL160_.jpg","Height":"160","Width":"160"},"LargeImage":{"URL":"https://images-na.ssl-images-amazon.com/images/I/41CrFkDPRrL.jpg","Height":"500","Width":"500"}},{"@attributes":{"Category":"primary"},"SwatchImage":{"URL":"https://images-na.ssl-images-amazon.com/images/I/41W%2Bpx9qmCL._SL30_.jpg","Height":"30","Width":"16"},"SmallImage":{"URL":"https://images-na.ssl-images-amazon.com/images/I/41W%2Bpx9qmCL._SL75_.jpg","Height":"75","Width":"39"},"ThumbnailImage":{"URL":"https://images-na.ssl-images-amazon.com/images/I/41W%2Bpx9qmCL._SL75_.jpg","Height":"75","Width":"39"},"TinyImage":{"URL":"https://images-na.ssl-images-amazon.com/images/I/41W%2Bpx9qmCL._SL110_.jpg","Height":"110","Width":"58"},"MediumImage":{"URL":"https://images-na.ssl-images-amazon.com/images/I/41W%2Bpx9qmCL._SL160_.jpg","Height":"160","Width":"84"},"LargeImage":{"URL":"https://images-na.ssl-images-amazon.com/images/I/41W%2Bpx9qmCL.jpg","Height":"500","Width":"263"},"HiResImage":{"URL":"https://images-na.ssl-images-amazon.com/images/I/61cFeTfmL-L.jpg","Height":"1501","Width":"789"}}]', 'Misc.', 'Majestic Pure', '{"Brand":"Majestic Pure","MPN":"B00XE58NJ8","UPC":"730544479528","Features":"PREMIUM QUALITY Castor Oil for healthy hair and skin - 100% pure, gentle and more effective natural castor oil. No additives, unfiltered and undiluted with no fillers. One of the finest natural skin emollients available.,Castor oil is famous for a wide range of skin benefits including helping with infections, sunburn, abrasions, acne, dry skin, boils, warts, stretch marks, age spots, athletes foot and chronic itching and inflamed skin. Castor oil can help beautify your skin and solve some of these toughest problems and inflammatory conditions.,SAFETY WARNING: For external use only. Rub a very small amount on the inside of your elbow area to test for any allergic reaction before use. Avoid contact with eyes, keep out of the reach of children. If pregnant, consult with your health care provider before use.,Castor Oil is readily and completely absorbed by skin. It has natural antibacterial and antifungal properties and is high in Vitamin E, minerals, proteins, and Omega 6 and 9 beneficial fatty acids. Its unusually high ricinoleic acid ratio makes it beneficial to skin and hair. It improves the appearance of the skin and gives it a youthful glow. Castor oil has traditionally been used topically for acne and other skin conditions. It is also used on the scalp to help prevent and remedy hair loss.,Majestic Pure Castor Oil is cruelty free and not tested on animals"}', NULL, '["PREMIUM QUALITY Castor Oil for healthy hair and skin - 100% pure, gentle and more effective natural castor oil. No additives, unfiltered and undiluted with no fillers. One of the finest natural skin emollients available.","Castor oil is famous for a wide range of skin benefits including helping with infections, sunburn, abrasions, acne, dry skin, boils, warts, stretch marks, age spots, athletes foot and chronic itching and inflamed skin. Castor oil can help beautify your skin and solve some of these toughest problems and inflammatory conditions.","SAFETY WARNING: For external use only. Rub a very small amount on the inside of your elbow area to test for any allergic reaction before use. Avoid contact with eyes, keep out of the reach of children. If pregnant, consult with your health care provider before use.","Castor Oil is readily and completely absorbed by skin. It has natural antibacterial and antifungal properties and is high in Vitamin E, minerals, proteins, and Omega 6 and 9 beneficial fatty acids. Its unusually high ricinoleic acid ratio makes it beneficial to skin and hair. It improves the appearance of the skin and gives it a youthful glow. Castor oil has traditionally been used topically for acne and other skin conditions. It is also used on the scalp to help prevent and remedy hair loss.","Majestic Pure Castor Oil is cruelty free and not tested on animals"]', '{"Height":"850","Length":"300","Weight":"100","Width":"300"}', 'USD', '1395', '1995', '1395', '600', NULL, 'Beauty', NULL, 'Castor Oil is one of the finest natural oils with numerous skin and hair benefits. Castor oil is a carrier oil derived from the castor bean seed in its purest form. Castor oil has natural antibacterial and antifungal properties and is high in Vitamin E, minerals, proteins, and Omega 6 and 9 beneficial fatty acids. If you would like to minimize the appearance of wrinkles on your face, castor oil may be able to help you. It has a low molecular weight, which means that it is absorbed fast by your skin. This means it can reduce the appearance of fine lines and wrinkles, as well as pimples, acne, eye bags, sunburn, dry skin, stretch marks, among others. It works well on itchy skin as well. When applied to the hair, castor oil gives silkier, more lustrous hair and can improve the overall condition of your locks. Massaging your scalp with castor oil can stimulate hair growth. Castor oil can also combat scalp infections that lead to a loss of hair. Its germicidal properties make it effective for several hair related conditions. Castor has also been found to help with many everyday problems such as inflammation, skin abrasions, sunburn, dry or scaly ski, ringworm, athletes foot, acne and migraines. The Majestic Pure Castor oil is derived from the castor bean seed in its purest form. Our oils are by far the most effective on the market.<br><br> [FDA Statement]: These Statements have not been evaluated by the food and drug administration. This product is not intended to diagnose, mitigate, treat, cure or prevent any disease.<br><br> <b>Click the button at the top of this page to buy with confidence.</b>', NULL, NULL, NULL, NULL, 'Review and List', 1, '110231430734', 177660, 20.46, 0, 0, 0, '2017-10-31 12:12:09', '2017-11-14 16:57:06');
