watchImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/51dgjv18DWL._SL30_.jpg","Height":"30","Width":"30"},"SmallImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/51dgjv18DWL._SL75_.jpg","Height":"75","Width":"75"},"ThumbnailImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/51dgjv18DWL._SL75_.jpg","Height":"75","Width":"75"},"TinyImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/51dgjv18DWL._SL110_.jpg","Height":"110","Width":"110"},"MediumImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/51dgjv18DWL._SL160_.jpg","Height":"160","Width":"160"},"LargeImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/51dgjv18DWL.jpg","Height":"500","Width":"500"},"HiResImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/71G6M79i0XL.jpg","Height":"1200","Width":"1200"}}]', NULL, 'TEMPO', '{"Brand":"TEMPO","MPN":"OUTBLACKWIRE200LEDS-001WA","UPC":"713923593206","Features":"Safe to Touch : 5V USB Powered Supply: which is easy to get access to USB port and no need any transformer, it has excellent heat dissipation and is safe to touch.\\u00a0Energy saving and environmental friendly, It is more brighter than solar powered strings lights, and more safe than the high voltage lights.,New upgraded version! Longer wire + more LEDs + sturdier quality\\uff1aSuper long length and more light beads:22m\\/72.2ft with 200 independent LEDs,8 different flash settings: Combination, In Waves, Sequential, Slo Glo, Chasing\\/ Flash, Slow Fade, Twinkle\\/Flash, Steady On will brighten up the dark corner for happiness atmosphere inside or outside.,IP65 Waterproof: Can withstand all kinds of weather, including heavy rain and snow, suitable for both indoor and outdoor decoration purpose in garden, yard, patio, doorway etc. Garnish your parties and events with the twinkling lights to turn ordinary to extraordinary.,Cost effective and energy efficient: Advanced LED technology will keep 97% of the electric energy turns into luminous energy, and no heat energy consumption; No radiation and UV protection, safe and power saving."}', 'Warm White', '["Safe to Touch : 5V USB Powered Supply: which is easy to get access to USB port and no need any transformer, it has excellent heat dissipation and is safe to touch.\\u00a0Energy saving and environmental friendly, It is more brighter than solar powered strings lights, and more safe than the high voltage lights.","New upgraded version! Longer wire + more LEDs + sturdier quality\\uff1aSuper long length and more light beads:22m\\/72.2ft with 200 independent LEDs","8 different flash settings: Combination, In Waves, Sequential, Slo Glo, Chasing\\/ Flash, Slow Fade, Twinkle\\/Flash, Steady On will brighten up the dark corner for happiness atmosphere inside or outside.","IP65 Waterproof: Can withstand all kinds of weather, including heavy rain and snow, suitable for both indoor and outdoor decoration purpose in garden, yard, patio, doorway etc. Garnish your parties and events with the twinkling lights to turn ordinary to extraordinary.","Cost effective and energy efficient: Advanced LED technology will keep 97% of the electric energy turns into luminous energy, and no heat energy consumption; No radiation and UV protection, safe and power saving."]', NULL, 'GBP', '1299', NULL, NULL, NULL, NULL, 'Lighting', NULL, '<b>Product Features:</b><br>1. Anti-cold and waterproof LED lights can against frost, it will work properly even though in cold winter. But please provent the USB charging port against water.<br>2. Lower power consumption: We have redesigned the structure of the fairy lights so that it uses even less electric power. Each bulb is only 0.05w, it means the fairy string light with 200 bulbs only consume 10W.<br>3. Safer than ever: We redesign the structure and make the output voltage down to a safe range 5V through USB charging port. (Safety boundary line is 36V).<br>4. Super bright with 8 flash modes, but it will keep to any modes when you turn it on at the next time.<br>5. Easy Installation and use: Just plug and play, no more procedures or notes; Different lighting effects are controlled by only the button.<br><br><b>Main Specifications:</b><br>1.Wire Material: Pure Copper<br>2.Wire Color: Black (better durable and heat dissipation)<br>3. Length: 72.2ft (include lead wire)<br>4. Distance between LED: 3.94in<br>5. Quantity of LED: 200<br>6. Working Voltage: 5V<br><br>Q: Are the wire and light beads fragile and easy to burn?<br>A: No, the strings was made of pure copper wire inside, 1.5mm diameter in total. USB poered design ensured It has excellent heat dissipation and is safe to touch.<br><br>Q: Do I have to assemble the light strip by myself?<br>A: No, the light is all ready for use, you could use it directly, plug-in any USB port.<br><br>Q: How is the lights effect?<br>A: Soft glow, perfect for all kinds of festival celebration use. It is more brighter than solar powered lights, and safer than the high voltage lights.<br><br>Q: Can I connect multiple sets of these lights together?<br>A: No, It have no tail plug to connect to another sets. And the brightness of the strings will be darken if the length is too long.<br><br>Click "Add to Cart" now to get it with 100% satisfaction warranty!', '{"Main Colour":["Blue","Cool white","Multi-color","Warm White"]}', '[{"sku":"UK7B075T6KJQF","qty":1,"price":"1299","attrs":[{"Name":"Main Colour","Value":"Blue"}]},{"sku":"UK7B075T1LKZ7","qty":1,"price":"1299","attrs":[{"Name":"Main Colour","Value":"Cool white"}]},{"sku":"UK7B075T7J9S5","qty":1,"price":"1299","attrs":[{"Name":"Main Colour","Value":"Multi-color"}]},{"sku":"UK7B075T7FGF3","qty":1,"price":"1299","attrs":[{"Name":"Main Colour","Value":"Warm White"}]}]', '{"Main Colour":{"Blue":["https://images-eu.ssl-images-amazon.com/images/I/511IKU%2BS8oL.jpg","https://images-eu.ssl-images-amazon.com/images/I/61pXOgk251L.jpg","https://images-eu.ssl-images-amazon.com/images/I/61G3ZnVFCoL.jpg","https://images-eu.ssl-ima