e solar power, so it will light up at dusk. <br><br><b>Package included</b><br>1* easyDecor 30 LED solar string lights<br>1* stand<br>1* spike<br>2* screws<br>1* User Instruction', '{"Color":["Multicolor(2 pack)","Warm White(1 pack)","White(1 pack)","White(2 pack)"]}', '[{"sku":"UK7B075CZHR3B","qty":1,"price":"1999","attrs":[{"Name":"Color","Value":"Multicolor(2 pack)"}]},{"sku":"UK7B075D71VCH","qty":1,"price":"1099","attrs":[{"Name":"Color","Value":"Warm White(1 pack)"}]},{"sku":"UK7B075CZ9QPK","qty":1,"price":"1099","attrs":[{"Name":"Color","Value":"White(1 pack)"}]},{"sku":"UK7B075F3Q768","qty":1,"price":"1999","attrs":[{"Name":"Color","Value":"White(2 pack)"}]}]', '{"Color":{"Multicolor(2 pack)":["https://images-eu.ssl-images-amazon.com/images/I/513NsA6urHL.jpg","https://images-eu.ssl-images-amazon.com/images/I/51HkcvfVO9L.jpg","https://images-eu.ssl-images-amazon.com/images/I/51CA9-1tMiL.jpg","https://images-eu.ssl-images-amazon.com/images/I/51eXbufyyJL.jpg","https://images-eu.ssl-images-amazon.com/images/I/514G7cpgX4L.jpg","https://images-eu.ssl-images-amazon.com/images/I/4162CdIKRgL.jpg","https://images-eu.ssl-images-amazon.com/images/I/51Hmed8rSGL.jpg"],"Warm White(1 pack)":["https://images-eu.ssl-images-amazon.com/images/I/61A2zYmXdHL.jpg","https://images-eu.ssl-images-amazon.com/images/I/61IfC0rPfJL.jpg","https://images-eu.ssl-images-amazon.com/images/I/51zuImaeD8L.jpg","https://images-eu.ssl-images-amazon.com/images/I/614xBCO27eL.jpg","https://images-eu.ssl-images-amazon.com/images/I/510gIEWwkiL.jpg","https://images-eu.ssl-images-amazon.com/images/I/417JABvyffL.jpg","https://images-eu.ssl-images-amazon.com/images/I/51MmSKFbkNL.jpg","https://images-eu.ssl-images-amazon.com/images/I/51s8ufb4ZjL.jpg"],"White(1 pack)":["https://images-eu.ssl-images-amazon.com/images/I/41jBeDuhmTL.jpg","https://images-eu.ssl-images-amazon.com/images/I/51CW5AKWFSL.jpg","https://images-eu.ssl-images-amazon.com/images/I/51Vo6zgkfKL.jpg","https://images-eu.ssl-images-amazon.com/im