, 'Doona', '{"Brand":"Doona","Model":"4897055660398","MPN":"CAR\\/SPA\\/","Features":"The world\'s first car seat that provides parents with a simple mobile solution,Ideal for families on the go - it converts to mobile in seconds for that quick dash from the car to home,Frees up space in the boot - great for travelling,Lightweight and easy to carry,Isofix Base available"}', 'Love Red', '["The world\'s first car seat that provides parents with a simple mobile solution","Ideal for families on the go - it converts to mobile in seconds for that quick dash from the car to home","Frees up space in the boot - great for travelling","Lightweight and easy to carry","Isofix Base available"]', '{"Height":"2598","Length":"2598","Weight":"1543","Width":"1732"}', 'GBP', '27900', NULL, NULL, NULL, '4897055660398', 'Automotive Parts and Accessories', NULL, '<p><b>The Doona Group 0+ Infant Car Seat in Love</b> is the first of its kind with fully integrated wheels. With the fully ergonomic design being focused on providing parents with a safe, secure and practical mobility solution for their baby; both in and outside of the car. This revolutionary design will change the way you live your life with your little one.</p><p>This particular car seat will suit your little one from birth until 13kg, fitting within the car seat group 0+. Designed to face rearwards within your car, this complies with a number of safety regulations including ECE R 44, EN 1888 and also EN 12790.</p>With multiple modes you have complete freedom of choice when it comes to the Doona Infant Car Seat; wheels on the underside of the car seat will extend out at the push of a button and turn into a lightweight and easy to use stroller.Furthermore, the clever and innovative design features double walls which will provide higher side-impact protection when in a collision. Unlike typical car seats, Doona\'s unique design enables positioning of the handle against the back of the seat of your car; through doing so, this will provide your baby with exceptional Anti-Rebound protection.</p><b>Features:</b></p><p><li>World\'s first infant car seat with integrated mobility solution</li><li>Group 0+ car seat - suitable from birth until 13kg</li><li>Developed in conjunction with medical experts</li><li>5 star frontal impact crash rating</li><li>Anti-bacterial, hypoallergenic and humidity and thermal regulating</li><li>BPA free materials</li><li>With push of a button, car seat turns into a stroller in seconds</li><li>No need to connect the seat to a seperate travel system</li><li>Easy to use installation system prevents improper vehicle installation</li><li>Double car seat walls provide higher side impact protection</li></p><p><b>Dimensions:</b></p><li>Car Seat Mode: H: 60 x W: 44 x D: 66cm</li><li>Pushchair Mode: H: 99 x D: 82cm</li>', '{"Color":["Love Red"]}', '{"2":{"sku":"UK7B00R7T0RGO","qty":1,"price":"27900","attrs":[{"Name":"Color","Value":"Love Red"}]}}', '{"Color":{"Love Red":["https://images-eu.ssl-images-amazon.com/images/I/41cWlVoNy0L.jpg","https://images-eu.ssl-images-amazon.com/images/I/414Uqd8QzbL.jpg","https://images-eu.ssl-images-amazon.com/images/I/41beloOIVcL.jpg","https://images-eu.ssl-images-amazon.com/images/I/41zvgB4ToML.jpg","https://images-eu.ssl-images-amazon.com/images/I/41u9iczIcfL.jpg","https://images-eu.ssl-images-amazon.com/images/I/51NVmsgdzvL.jpg","https://images-eu.ssl-images-amazon.com/images/I/41jpN%2BRb3WL.jpg","https://images-eu.ssl-images-amazon.com/images/I/31kCvwNJrgL.jpg","https://images-eu.ssl-images-amazon.com/images/I/51Pfd%2BiF2nL.jpg"]}}', NULL, 'Review and List', 0, NULL, 66695, NULL, 0, 0, 0, '2017-11-13 16:43:06', '2017-11-13 16:43:06'),
(123, 1, 2, 'B07146DW98', 'UK7B07146DW98', 1, 3887765031, 'https://www.amazon.co.uk/Doona-Essentials-Bag-Storm/dp/B07146DW98?psc=1&SubscriptionId=AKIAJL5OCKUJ5TXWF47Q&tag=dropshipping7-20&linkCode=xm2&camp=2025&creative=165953&creativeASIN=B07146DW98', 'Doona Essentials Bag (Storm)', NULL, '670534589113', 'https://images-eu.ssl-images-amazon.com/images/I/41qssbj6mnL.jpg', '{"@attributes":{"Category":"primary"},"SwatchImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/41qssbj6mnL._SL30_.jpg","Height":"30","Width":"25"},"SmallImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/41qssbj6mnL._SL75_.jpg","Height":"75","Width":"62"},"ThumbnailImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/41qssbj6mnL._SL75_.jpg","Height":"75","Width":"62"},"TinyImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/41qssbj6mnL._SL110_.jpg","Height":"110","Width":"92"},"MediumImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/41qssbj6mnL._SL160_.jpg","Height":"160","Width":"133"},"LargeImage":{"URL":"https://images-eu.ssl-images-amazon.com/images/I/41qssbj6mnL.jpg","Height":"500","Width":"416"}}', 'Baby Product', 'Doona', '{"Brand":"Doona","UPC":"670534589113","Features":"Compact, lightweight and elegant design,Designed to maintain your Doona\'s stability,Smart and practical compartments,Can carry a weight of up to 1.5kg,Not suitable for use within a vehicle"}', 'Storm', '["Compact, lightweight and elegant design","Designed to maintain your Doona\'s stability","Smart and practical compartments","Can carry a weight of up to 1.5kg","Not suitable for use within a vehicle"]', NULL, 'GBP', '5493', NULL, NULL, NULL, NULL, 'Baby Product', NULL, '<P>The Doona Essentials Bag in Storm is the perfect lightweight accessory for all of your fun filled adventures with your little one.</P> <P>It is compact, light-weight and features an elegant design, perfect for your days out with your baby. There are a number of smart and practical compartments for you to store yours and your baby\'s essentials, ideal for quick trips to the shops or quick visits to family or friends. The Doona Essentials Bag can carry a whole bundle of essentials and will hold a maximum weight of 1.5kg.</P> <P>The Doona Essentials Bag has been specifically designed to maintain your Doona Infant Car Seat\'s stability and to also prevent against entaglement hazards. This means that this is perfect for your Doona Infant Car Seat, and it gives you one less thing to worry about!</P> <P>This travel bag is not suitable for use within the car, therefore, the unique quick release Doona connectors will allow you to connect or remove the bag within seconds.</P> <UL>Features: <LI>Compact, light-weight and elegant design</LI> <LI>Specifically designed to maintain your Doona\'s stability</LI> <LI>Prevent an entaglement hazard</LI> <LI>Unique quick release Doona connectors</LI> <LI>Smart and practical compartments</LI> <LI>Easy to wash</LI> <LI>Can carry a weight of up to 1.5kg</LI> <LI>Not suitable for use within a vehicle</LI>', '{"Color":["Sky","Dune","Dune Beige","Night","Sweet"]}', '{"1":{"sku":"UK7B0719CPZVY","qty":1,"price":"5500","attrs":[{"Name":"Color","Value":"Sky"}]},"2":{"sku":"UK7B071VMM277","qty":1,"price":"5500","attrs":[{"Name":"Color","Value":"Dune"}]},"3":{"sku":"UK7B00PLI1NXY","qty":1,"price":"5500","attrs":[{"Name":"Color","Value":"Dune Beige"}]},"4":{"sku":"UK7B071S1VW9C","qty":1,"price":"5948","attrs":[{"Name":"Color","Value":"Night"}]},"6":{"sku":"UK7B071F3QSDP","qty":1,"price":"5500","attrs":[{"Name":"Color","Value":"Sweet"}]}}', '{"Color":{"Sky":["https://images-eu.ssl-images-amazon.com/images/I/51gSkAbUnDL.jpg","https://images-eu.ssl-images-amazon.com/images/I/414jqfZCENL.jpg","https://images-eu.ssl-images-amazon.com/images/I/519LiJHTKWL.jpg","https://images-eu.ssl-images-amazon.com/images/I/41EVcfVISpL.jpg"],"Dune":["https://images-eu.ssl-images-amazon.com/images/I/41QZEszJnzL.jpg"],"Dune Beige":["https://images-eu.ssl-ima