 significantly whiten and brighten your smile. It\'s 100% natural & vegan friendly. No additives, preservatives or any other nasties. ? </br></br> At Pro Teeth Whitening Co our aim is to provide high quality, safe and effective teeth whitening products at affordable prices.This 100% natural tooth polish removes stains and discolouration from the surface of your teeth to significantly whiten and brighten your smile. </br></br> Activated charcoal is used today and has been used throughout the centuries to treat people who have accidentally ingested poison - with its porous surface, it attaches to toxins and impurities in the body to draw them out. It works in just the same way on plaque, tannins and stains on teeth - safely and efficiently lifting these off! </br></br> This polish is made with premium finely ground food grade activated charcoal, ideal for dental use and non-abrasive, Bentonite clay aids the charcoal\'s work, absorbing heavy metals and delivering essential minerals, while organic peppermint to soothe, fight bacteria, reduce inflammation and add freshness.</br></br> </br></br> ** If you suffer from any type of gum irritation or sensitive teeth/gums, or have a history of gum infection please consult your dentist prior to use **', '{"FlavorName":["Peppermint","Spearmint","Strawberry"]}', '[{"sku":"UK7B01IVKWNAU","qty":1,"price":"1199","attrs":[{"Name":"FlavorName","Value":"Peppermint"}]},{"sku":"UK7B073GZJBTP","qty":1,"price":"1199","attrs":[{"Name":"FlavorName","Value":"Spearmint"}]},{"sku":"UK7B073GY1WMT","qty":1,"price":"1199","attrs":[{"Name":"FlavorName","Value":"Strawberry"}]}]', '{"FlavorName":{"Peppermint":["https://images-eu.ssl-images-amazon.com/images/I/618As9xxgxL.jpg","https://images-eu.ssl-images-amazon.com/images/I/51f-a27hSSL.jpg","https://images-eu.ssl-images-amazon.com/images/I/51Z1l6AGWuL.jpg","https://images-eu.ssl-images-amazon.com/images/I/61MO%2Bnw5ObL.jpg","https://images-eu.ssl-images-amazon.com/images/I/51jhUkA5azL.jpg","https://